function GetService(props) {
  return (
    <div className="GetService">
      <Container>
        <Row>
          <Col md={12}>
            <p className="RegularParagraph">How it works</p>
            <h3 className="SectionHeading">Easiest way to get a service</h3>
          </Col>
          <Col md={12}>
            <Row>
              <Col md={6}>
                <div 
                  className="GetService-Banner GetService-Banner__Video d-flex justify-content-center align-items-center"
                  style={{ backgroundImage: 'url(./static/images/GetServices/process-thumbnail.jpg)' }}
                  // onClick={() => setModal({ isActive: true, slug: GetService.video })}
                >
                  <Image src="./static/images/play-btn.svg" className="GetService-Banner__Video--PlayBtn" />
                </div>
              </Col>
              <Col md={6}>

              </Col>
            </Row>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default GetService;
